"use strict";$(document).ready(function(){new Quill('[data-editor-target="editor"]',{placeholder:"Write a detailed description about this item",theme:"snow"})}),$(document).ready(function(){$('[data-alert-target="#alertMessage"]').click(function(e){e.preventDefault();const t=Swal.mixin({customClass:{confirmButton:"btn btn-success m-1",cancelButton:"btn btn-danger m-1"},buttonsStyling:!1});t.fire({title:"Add Menu Item",text:"Do you want to save this menu item?",icon:"warning",showCancelButton:!0,confirmButtonText:"Yes, I do",cancelButtonText:"No, Go Back",reverseButtons:!0}).then(e=>{e.value?t.fire("Sent!","Proposal sent successfully.","success"):e.dismiss===Swal.DismissReason.cancel&&t.fire("Cancelled","Your imaginary file is safe :)","error")})})}),$(document).ready(function(){var e=document.getElementById("startDate"),t=document.getElementById("dueDate");new Datepicker(e,{clearBtn:!0,allowOneSidedRange:!0}),new Datepicker(t,{clearBtn:!0,allowOneSidedRange:!0})});